import { colors, media } from 'src/styles';
import styled from 'styled-components';

export const Container = styled.div`
  background: ${colors.background};
  height: 100vh;
  width: 100vw;
  flex-flow: column nowrap;

  ${media.mobileS} {
    background: ${colors.secondary};
  }
  //flex-flow: row wrap;
`;
